function Button(props) {
  const position = { item: "py-1.5 px-5" };
  const design = {
    item: "border border-gray-300 rounded-3xl",
    condition: props.light
      ? "bg-white border-gray-700 text-gray-800"
      : "bg-gray-900 text-white",
  };

  return (
    <button
      className={`${position.item} ${design.item} ${design.condition}`}
      onClick={props.onClick}
    >
      {props.text}
    </button>
  );
}

export default Button;
